import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <Router>
      <Switch>
        <Route path='/' exact Component={UserRegistration}></Route>
        <Route path='/home' Component={HomePage}></Route>
      </Switch>
    </Router>
  );
}

export default App;
